import React, { useContext } from 'react';
import { Link } from 'react-router-dom';
import styled, { keyframes } from 'styled-components';
import { colorContext } from './path/to/your/ColorContext';

// Keyframes for animations
const fadeIn = keyframes`
  0% {
    opacity: 0;
    transform: translateY(30px);
  }
  100% {
    opacity: 1;
    transform: translateY(0);
  }
`;

const fadeInContainer = keyframes`
  0% {
    opacity: 0;
  }
  100% {
    opacity: 1;
  }
`;

const float = keyframes`
  0% {
    transform: translate(-50%, -50%) translateY(0);
  }
  50% {
    transform: translate(-50%, -50%) translateY(-30px);
  }
  100% {
    transform: translate(-50%, -50%) translateY(0);
  }
`;

const Landing = () => {
  const { config } = useContext(color); // Access color context

  return (
    <Container bg={config.landing.bg}>
      <Left>
        <TextLeft color={config.landing.textPrimary}>
          V <span className="i">I</span>
        </TextLeft>
      </Left>

      <Center>
        <ShopLink color={config.landing.linkText} className="shopLink" href="#shop">V</ShopLink>
        <ShopLink color={config.landing.linkText} className="shopLink2" href="#shop">I</ShopLink>
        <ShopLink color={config.landing.linkText} className="shopLink3" href="#shop">O</ShopLink>
        <ShopLink color={config.landing.linkText} className="shopLink4" href="#shop">L</ShopLink>
        <ShopLink color={config.landing.linkText} className="shopLink5" href="#shop">A</ShopLink>
        O
      </Center>

      <CenterButtons>
        <Link to="/store">
          <StoreButton bg={config.landing.btnBg} color={config.landing.btnText}>فروشگاه</StoreButton>
        </Link>
      </CenterButtons>

      <CenterButtons2>
        <Link to="/about">
          <AboutButton bg={config.landing.subHeader} color={config.landing.btnText}>درباره ما</AboutButton>
        </Link>
      </CenterButtons2>

      <Right>
        <TextRight color={config.landing.textPrimary}>
          L <span className="a">A</span>
        </TextRight>
      </Right>
    </Container>
  );
};

// Styled Components

const Container = styled.div`
  display: flex;
  height: 100vh;
  width: 100%;
  position: relative;
  opacity: 0;
  font-family: 'Trebuchet MS', 'Lucida Sans Unicode', 'Lucida Grande', 'Lucida Sans', Arial, sans-serif;
  background-color: ${({ bg }) => bg};  // Apply dynamic background color
  animation: ${fadeInContainer} 2s ease-in-out forwards;
`;

const Left = styled.div`
  flex: 1;
  height: 100%;
  backdrop-filter: blur(18px);
  display: flex;
  justify-content: center;
  align-items: center;
  position: relative;
`;

const Right = styled.div`
  flex: 1;
  height: 100%;
  background: rgba(186, 85, 211, 0.7);
  backdrop-filter: blur(18px);
  display: flex;
  justify-content: center;
  align-items: center;
  position: relative;
`;

const Center = styled.div`
  position: absolute;
  top: 50%;
  left: 50%;
  font-family: 'Times New Roman', Times, serif;
  transform: translate(-50%, -50%);
  font-size: 300px;
  font-weight: bold;
  color: #4B3C67;
  text-shadow: 4px 4px 40px rgba(0, 0, 0, 0.3);
  z-index: 2;
  opacity: 0;
  animation: ${fadeIn} 3s ease-in-out forwards, ${float} 2s infinite ease-in-out;
  cursor: pointer;
`;

const ShopLink = styled.p`
  position: absolute;
  font-size: 20px;
  font-weight: bold;
  color: ${({ color }) => color};  // Apply dynamic link color
  text-decoration: none;
  opacity: 0.5;
  z-index: 3;
  transition: color 0.3s ease, transform 0.3s ease;
  cursor: pointer;
`;

const CenterButtons = styled.div`
  z-index: 100;
  right: 50%;
  top: 80%;
  position: absolute;
`;

const CenterButtons2 = styled.div`
  z-index: 100;
  top: 80%;
  left: 50%;
  position: absolute;
`;

const StoreButton = styled.button`
  color: ${({ color }) => color};  // Apply dynamic text color
  z-index: 100;
  border-radius: 50px 0px 0px 500px;
  background-color: ${({ bg }) => bg};  // Apply dynamic background color
  border: none;
  padding: 30px;
  font-family: 'Vazir', 'Playfair Display', serif;
  text-align: center;

  &:hover {
    background-color: #9B59B6;
    transform: scale(1.05);
  }

  &:active {
    background-color: #8E44AD;
    transform: scale(1);
  }
`;

const AboutButton = styled.button`
  color: ${({ color }) => color};  // Apply dynamic text color
  z-index: 100;
  border-radius: 0px 50px 500px 0px;
  background-color: ${({ bg }) => bg};  // Apply dynamic background color
  text-align: center;
  border: none;
  font-family: 'Vazir', 'Playfair Display', serif;
  padding: 30px;
`;

const TextLeft = styled.div`
  font-size: 120px;
  font-weight: bold;
  color: ${({ color }) => color};  // Apply dynamic text color
  z-index: 1;
  opacity: 0;
  animation: ${fadeIn} 2s ease-in-out forwards;
  animation-delay: 0.5s;
  cursor: pointer;
  font-family: 'Times New Roman', Times, serif;
`;

const TextRight = styled.div`
  font-size: 120px;
  font-weight: bold;
  color: ${({ color }) => color};  // Apply dynamic text color
  z-index: 1;
  opacity: 0;
  animation: ${fadeIn} 2s ease-in-out forwards;
  animation-delay: 1s;
  font-family: 'Times New Roman', Times, serif;
`;

export default Landing;
